import React from 'react';
import { useParams } from 'react-router-dom';

const Project = () => {
  const { projectId } = useParams();

  return (
    <div>
      <h2>Project Details</h2>
      <p>Project ID: {projectId}</p>
      {/* Fetch project details using projectId */}
    </div>
  );
};

export default Project;
